import React, { useState } from 'react';
import { observer } from 'mobx-react';

import Finder from './features/Finder/Finder';
import {Values} from './features/Finder/Finder';
import './App.css';
import Schedule from './features/Schedule/Schedule';
import ScheduleStore from './features/Schedule/ScheduleStore';

export interface Params {
  from: '';
  to: '';
  direction: '';
}

function App() {
  const [params, setParams] = useState<Values>({
    from: '',
    to: '',
    direction: '',
  })

  const { getSchedules, status } = ScheduleStore;

  console.log(status);

  return (
    <div className="App">
      <button type="button" onClick={getSchedules}>CLICK ME</button>
      <Finder setParams={setParams} /> 
      {Object.values(params).length > 0 && <Schedule />}
    </div>
  );
}

export default observer(App);
